import React from 'react';
import { NavLink } from 'react-router-dom';
import web from '../src/images/img1.jpg';
import Common from './Common';

const Home=()=>{
    return(
        <>
            <Common name="Good Times + Crazy Friends = Great Memories!" imgsrc={web} visit="/Service"/>
        </>
    );
};


export default Home;
